import React from 'react';
import './profile.css';



class profile extends React.Component {
     constructor(props) {
          super(props);
          this.state =({
             user: []
          //User is the current signed in user profile sent from the database
          })
        }

     //   Render the User Profile if exist or in session
     userProfile  = () =>{
          return(
               <div>
                    <h3>Welcome User</h3>
               </div>
          )
     }
     
     //   Render the login screen
     login = () =>{
          return(
               <div>
                    <h3>Login</h3>
               </div>
          )
     }

      //   Render the signin screen
      Signin = () =>{
          return(
               <div>
                    <h3>Sign Up</h3>
               </div>
          )
     }

     // Render the 
     renderview(){           
          switch(this.state.authenticate){
              default: 
                  case []: return this.login();
                  case !false: return this.userProfile();
          }
      }
      
    
     render(){
          return(
          <div className="profile">
               Profile
               {this.renderview}
          </div>
          )
     }
}
export default profile;
